    "\n",
    "df = dataset.dropna(subset=[\"date\"])\n",
    "\n",
    "df_sort = df.sort_values(\"date\")\n",
    "\n",
    "date_bins = pd.cut(df_sort[\"date\"], bins=10)\n",
    "date_bins = pd.Categorical(date_bins)\n",
    "\n",
    "date_labels = [date.strftime(\"%Y-%m\") for date in date_bins.categories.left]\n",
    "\n",
    "\n",
    "# Plot the revenue trend with bins on the x-axis\n",
    "plt.figure(figsize=(20, 8))\n",
    "sns.lineplot(x=date_bins.astype(str), y=\"revenue\", data=df_sort, marker=\"o\", errorbar=None)\n",
    "plt.xlabel(\"Date Bins\")\n",
    "plt.ylabel(\"Revenue\")\n",
    "plt.title(\"Revenue Trends Over Time (Binned)\")\n",
    "plt.xticks(rotation=45)\n",
    "plt.gca().set_xticklabels(date_labels)\n",
    "\n",
    "plt.show()\n"
